import React, { useState } from 'react';
import {
  Form,
  Input,
  Button,
  Select,
  Space
} from 'antd';
const { Option } = Select;

const AddMentor = () => {

  return (
    <>
      <Space><h1>Add Mentor</h1></Space>
      <Form
        labelCol={{
          span: 8,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: 'small',
        }}
      >
        <Form.Item label="Mentor Name">
          <Input />
        </Form.Item>
        <Form.Item label="Mentor Email">
          <Input />
        </Form.Item>
        <Form.Item label="Confirm Mentor Email">
          <Input />
        </Form.Item>
        <Form.Item label="Select Companies">
         <Select mode="multiple" >
          <Option value="red">Red</Option>
          <Option value="green">Green</Option>
          <Option value="blue">Blue</Option>
        </Select>
        </Form.Item>
        <Form.Item>
          <Button style={{paddingLeft: 50}}>Submit</Button>
        </Form.Item>
      </Form>
    </>
  );
};

export default AddMentor;
